import React from "react";
import Button from "./Button";


const Nav = (props) => {


    return (

        <nav className={"top-menu"}>
            <ul>
                <li>
                    <img src={props.logo} className={"nav-logo"} alt={"Logo"} />
                </li>
                <li>
                    <Button buttonName={"Program"} buttonType={"nav"} />
                </li>
                <li>
                    <Button buttonName={"Sök"} buttonType={"nav"} />
                </li>
                <li style={{ alignSelf: "right" }}>
                    <Button buttonName={"Logga in"} buttonType={"nav"} />
                </li>
            </ul>
        </nav >

    )
}

export default Nav;
